SharePointParsingTest_DEV_1 As screen:
    LoadingSpinnerColor: =RGBA(105, 121, 126, 1)
    OnVisible: |-
        =Clear(colCalendar_TEST_DEV);
        ForAll(
           Sequence(2000),
           Collect(
              colCalendar_TEST_DEV,
              DateAdd(
                 Today(),
                 -1*Value,
                 TimeUnit.Days
              )
           )
        );
        
        Clear(colCars);
        ForAll(
            colCalendar_TEST_DEV,
            Collect(colCars, Filter(똑실이_Token_table, Token_Date=Value))
        );

    Label4 As label:
        BorderColor: =RGBA(0, 0, 0, 0)
        BorderStyle: =BorderStyle.None
        BorderThickness: =2
        Color: =RGBA(51, 51, 51, 1)
        DisabledBorderColor: =RGBA(0, 0, 0, 0)
        DisabledColor: =RGBA(166, 166, 166, 1)
        FocusedBorderThickness: =4
        Font: =Font.'Segoe UI'
        Size: =13
        Text: =CountRows(colCars)
        X: =393
        Y: =258
        ZIndex: =1

